SELECT [NULL, '25.6', '-0.02', NULL], [NULL], 1024, [NULL, '10485.76', NULL, NULL], [NULL, '-922337203.6854775808', to_nullable(NULL)], [NULL] FROM (SELECT [multi_if((number % 1023) = -inf, to_string(number), NULL)], NULL, '-1', multi_if((number % NULL) = NULL, to_string(number), ''), [NULL, NULL], multi_if((number % NULL) = 65536, to_string(number), '') AS s FROM system.numbers) LIMIT 1024 format Null
